  display: flex;
  align-items: center;
  background-color: #f9ceb8;
`;
const Title = styled.div`
  margin: 15px;
  font-size: 25px;
`;
const BooksContainer = styled.div``;
const ItemContainer = styled.div``;
const Image = styled.img``;
const Name = styled.p``;
const Price = styled.h3``;

const Books = () => {
  return (
    <Container>
      <TitleContainer>
        <Title>Best Selling Books</Title>
      </TitleContainer>
      <hr />
    </Container>
  );
};

export default Books;
